8	Approved plan / list of amenities proposed in the site.	N	70
9	NOCs issued by Authority (where applicable viz., Airport Authority, Fire Department, Environmental Clearance, etc.).	N	70
10	Detailed technical specifications of the construction if the buildings and facilities proposed in the project including brand details, specifications of infrastructure and details of fixtures and fittings (refer Form P18 in forms download).	N	70
